import React, { Component } from 'react'

export default class Footer extends Component {
  constructor(props) {
		super(props);
		this.state = {

		};
  }

  render() {
    return (
      <div id="footer">
        <div className="footer_top">
          <div className="footer_wrapper">
            <h5>Sarah Alt</h5>
            <p>Frontend Developer. Psychologist. Entrepreneur.</p>
            <span>Website made with <img className="heart" src="/assets/images/icons/heart.png" alt=""/> in Munich, Germany</span>
            <div className="footer_contact">
              <a href="https://www.linkedin.com/in/sealt/" target="_blank"><img className="social-media-icon" src="/assets/images/icons/linkedin.png" alt=""/></a>
              <a href="https://www.instagram.com/seabysalt/" target="_blank"><img className="social-media-icon" src="/assets/images/icons/ig.png" alt=""/></a>
              <a href="https://github.com/seabysalt/" target="_blank"><img className="social-media-icon" src="/assets/images/icons/githubWhite.png" alt=""/></a>
            </div>
            {/* <h6>Currently looking for a job.</h6> */}
          </div>
        </div>
        <div className="footer_overlay">

        </div>

      </div>
    )
  }
}
